import React from 'react';
import { Button } from '@mui/material';
function PokemonAdd() {
    const handleClick = e => {
        e.preventDefault();
        console.log(e.target.value);
    }
    return (
    <Button
    onClick={handleClick}>
        Add Pokemon
    </Button>);

}

export default PokemonAdd;
